import { Component, OnInit, HostListener } from '@angular/core';

@Component({
  selector: 'app-help',
  templateUrl: './help.component.html',
  styleUrls: ['./help.component.scss'],
  host: {
    '(contextmenu)': 'preventDefault($event)'
  }
})
export class HelpComponent implements OnInit {

  pageVariable
  pdfSrc: any;
  @HostListener('window:scroll', ['$event']) onScrollEvent($event) {
    // 
    
  }
  @HostListener('window:keydown', ['$event']) onKeydownEvent($event) {
    
    
    this.preventDefault($event)
  }
  // src = "assets/pdf_open_parameters.pdf#toolbar=0&navpanes=0&statusbar=0&view=Fit;readonly=true; disableprint=true;";
  src = ``
  constructor() { }

  ngOnInit() {
    this.onFileSelected();
  }
  preventDefault(event) {
    

    event.preventDefault();
  }
  scrolled(event) {
    
  }
  pageRendered(e: CustomEvent) {
    
    
  }
  onFileSelected() {
    if (typeof (FileReader) !== 'undefined') {
      let reader = new FileReader();
      let blob = this.b64toBlobModified(this.src)
      reader.onload = (e: any) => {
        
        this.pdfSrc = e.target.result;
      };
      reader.readAsArrayBuffer(blob);

      // reader.readAsArrayBuffer($img.files[0]);
    }
  }
  b64toBlob() {
    const byteCharacters = atob(this.src);
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    let blob = new Blob([byteArray])
    return blob
  }

  b64toBlobModified = (b64Data, contentType = '', sliceSize = 512) => {
    const byteCharacters = atob(b64Data);
    const byteArrays = [];

    for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
      const slice = byteCharacters.slice(offset, offset + sliceSize);

      const byteNumbers = new Array(slice.length);
      for (let i = 0; i < slice.length; i++) {
        byteNumbers[i] = slice.charCodeAt(i);
      }

      const byteArray = new Uint8Array(byteNumbers);
      byteArrays.push(byteArray);
    }

    const blob = new Blob(byteArrays, { type: contentType });
    return blob;
  }

}
